const Nav = () => {
	return (
		<nav className='menu'>
			<div className='menu__list'>
				<a href="" className='menu__item'>Profile</a>
				<a href="" className='menu__item'>Messages</a>
				<a href="" className='menu__item'>News</a>
				<a href="" className='menu__item'>Music</a>
			</div>
		</nav>
	)
}

export default Nav;
